import Head from 'next/head'
import Link from 'next/link'
import Layout from '../components/layout'
import Button from 'react-bootstrap/Button'

export default function ConfirmDelete() {
  return (
    <Layout>
      <div className="container-center">
        <div className="intro-header px-4">
          <h1 className="display-4">You information has been deleted from our servers</h1>
          <p className="p-delete">You should receive a confirmation email within the next few minutes.</p>
          <p className="p-delete">You are no longer signed up to our service but you can re-join at any time.</p>
          <Link href="/signup">
            <a>
              <Button className="signup-btn mt-2" size="lg">
                Get notified
              </Button>
            </a>
          </Link>
        </div>
      </div>

      <style jsx>{`
        .p-delete {
          font-size: 20px;

        }
        `}
      </style>

      <style jsx global>{`
          .signup-btn {
            background-color: #333!important;
            border-color: #333!important;
            padding: 1rem 2rem!important;
            color: #FFF!important;
          }

          .signup-btn:hover {
            background-color: #FFF!important;
            border-color: #333!important;
            color: inherit!important;
          }
          `}
      </style>

    </Layout>
  )
}
